#just-dance-now {
    background-image: url(https://imgur.com/MoeYb84.png) !important
}

.state-afterdance #just-dance-now
{
    background-image: url(https://imgur.com/tDVFwnr.png) !important;
    position: relative;
    background-position: center;
    background-size: cover;
    background-repeat: no-repeat;
}

.song-cover--hi-res {
    border: none !important;
    transform: scale(4.7);
    height: 51%;
    left: 5%;
    background-image: none !important;
    transition: none !important
}

.song-preview {
    transition: .1s all !important
}

.state-coachselection .song-cover--low-res {
    z-index: 9999999999999999999999999999999999 !important;
}

.state-songselection #just-dance-now::before {
    content: "";
    display: block;
    height: 200%;
    width: 120%;
    background-size: cover;
    transform: scale(0.05) translatey(-940%) translatex(-940%);
    z-index: 999999999999999999999999 !important;
    background-image: url(https://media.discordapp.net/attachments/678906842755235840/716442011221229608/jdpc.png?width=492&height=492);
}

.song-cover::before {
    content: "";
    position: fixed;
    display: block;
    top: -50%;
    height: 200%;
    left: 0%;
    width: 100%;
    background-position: center;
    background-size: cover;
    transform: scale(0.32);
    clip-path: polygon(100% 0, 100% 100%, 0 100%, 0 0) !important;
    z-index: 999999999999999999999999 !important;
    -webkit-mask-image: linear-gradient(180deg, rgb(0, 0, 0) 93%, #f000 100%) !important;
}

.state-coachselection .song-cover::before {
    left: 20%;
    transform: scale(0.32);
    top: 50%
}

.song-cover::after {
    content: "";
    position: fixed;
    display: block;
    top: -0%;
    height: 100%;
    left: 0%;
    width: 100%;
    background-position: center;
    background-size: cover;
    transform: scale(1.0);
    
}

.state-coachselection .song-cover::after {
    transform: scale(1.2)
}

.state-songselection .song-cover::after {
    clip-path: polygon(100% 20%, 100% 53%, 0 87%, 0 55%);
}


.state-coachselection .song-cover {
    top: 43%;
}

