.state-coachselection .song-detail__title,
.state-coachselection .song-detail__artist {
    animation: TextAlign 3s !important;
}

.state-coachselection .song-cover::before {
    animation: StateAlbumFade 3s ease-in-out !important;
}

.state-coachselection .song-cover::after{
    animation: OpacityFade 0.8s !important
}

@keyframes OpacityFade {
    0% {
        opacity: 0
    }

    100% {
        opacity: 1
    }
}

.state-coachselection #preview .song-details {
    animation: SongDetailsCoach 3s ease-in-out !important;
}

.state-coachselection .song-detail__title {
    animation: TextTransform1 3s !important
}

.state-coachselection .song-detail__artist {
    animation: TextTransform2 3s !important
}


@keyframes TextTransform1 {
    0% {
        transform: translatey(100%);
        text-align: right;
        font-size: 35%
    }

    100% {
        transform: translatey(100%);
        text-align: right;
        font-size: 35%
    }
}

@keyframes TextTransform2 {
    0% {
        transform: translatey(-85%);
        text-align: right;
        font-size: 18%
    }

    100% {
        transform: translatey(-85%);
        text-align: right;
        font-size: 18%
    }
}


@keyframes TextAlign {
    0% {
        text-align: right
    }

    100% {
        text-align: right
    }
}

@keyframes StateAlbumFade {
    0% {
        opacity: 0;
        top: -50%;
        left: -0.8em;
    }

    10% {
        opacity: 0;
    }

    30% {
        opacity: 0;
    }

    40% {
        left: 0.5em;
        opacity: 1
    }

    60% {
        opacity: 1
    }

    85% {
        opacity: 1;
        left: 0.5em
    }

    90% {
        opacity: 1
    }

    95% {
        opacity: 0
    }

    100% {
        opacity: 0;
        top: -50%;
        left: 0.6em;
    }
}


@keyframes SongDetailsCoach {
    0% {
        opacity: 0;
        top: -10%;
        left: -100%;
        width: 110%;
        transform: scale(1.3)
    }

    10% {
        opacity: 0;
    }


    30% {
        opacity: 1;
    }

    35% {
        opacity: 1;
        left: -60%
    }

    85% {
        opacity: 1;
        left: -60%
    }


    95% {
        opacity: 0;
    }

    100% {
        opacity: 0;
        top: -10%;
        left: -65%;
        width: 110%;
        transform: scale(1.3)
    }
}

